<html><body><text id="wikipedia_wo_wikipedia_org__5586.html" ns="0" revid="104058" sourceurl="https://wo.wikipedia.org/wiki/Waxset" title="Waxset" type="wikipedia">Waxset<p><hi rend="bold">Waxset</hi> mooy juroom-ñetteelu <ref target="https://wo.wikipedia.org/wiki/Weer">weer</ref> ci <ref target="https://wo.wikipedia.org/wiki/Arminaatu_Gregori">arminaatu Gregori</ref> ak ci bu <ref target="https://wo.wikipedia.org/wiki/Arminaatu_Suul">Suul</ref>.</p>
<p>Turam ma ngi jóge ci <ref target="https://wo.wikipedia.org/wiki/Augustus">Augustus</ref>, ngir màggalee ko ko moom mi nekkoon buuru <ref target="https://wo.wikipedia.org/wiki/Rom">Rom</ref> ci 8 nj. j. Isaa. laataa moom moo nekkoon juroom-benneelu weer ci <ref target="https://wo.wikipedia.org/wiki/Arminaatu_waa-rom">arminaatu waa-rom</ref> bu jamono ju yàgg ja. </p>
</text></body></html>
